import React from 'react';
import { Link } from 'react-router-dom';

function PageTitle({ titleText, onClick, link }) {
    return (
        <div className='page-title' style={{ color: "black" }}>
            {link ? (
                <Link to={link}>
                    <img
                        src='./UI/UI_X.png'
                        style={{ height: "20px", position: "relative", left: "0", cursor: "pointer" }}
                        alt="Page Icon"
                    />
                </Link>
            ) : (
                <img
                    src='./UI/UI_X.png'
                    style={{ height: "20px", position: "relative", left: "0", cursor: "pointer" }}
                    alt="Page Icon"
                    onClick={onClick}
                />
            )}

            <h1>{titleText}</h1>
        </div>
    );
}

export default PageTitle;
